import { Card } from "../Card"
import "./Cards.css"

type props = {
  cards: Card[]
}

export function Cards({cards} : props) {
  return (
    <div>
      {cards.map(card => (
        <div>
          <img src={card.image} />
          <h3 content={card.title}/>
        </div>
      ))}
    </div>
  )
}
